const getNastavnici = (state = [], action) => {
  if (action.type === 'GET_NASTAVNICI') {
    const nastavnici = fetch('http://localhost:3001/nastavnici')
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
      })
      .then((result) => result);
    return nastavnici;
  }
  return state;
};

export default getNastavnici;
